function isEmpty(s)
{return((s===null)||(s===undefined)||(s.length===0));}
function isDigit(c)
{return((c>="0")&&(c<="9"));}
function isInteger(s)
{var i;if(isEmpty(s)){if(isInteger.arguments.length==1){return 0;}}
for(i=0;i<s.length;i++){var c=s.charAt(i);if(!isDigit(c)){return false;}}
return true;}
function openWindowToSize(url,width,height){openWindowToSize(url,width,height,"default");}
function openWindowToSize(url,width,height,winType){var strOptions="height="+height+",width="+width+",left=80,top=100,location,menubar,resizable,scrollbars,status,toolbar";if(winType=="console"){strOptions="resizable,height="+height+",width="+width;}
if(winType=="fixed"){strOptions="status,scrollbars,height="+height+",width="+width;}
var w=window.open("","win",strOptions);w.location.href=url;w.focus();}
function hideApplets(){var nodes=document.getElementsByTagName('applet');if(nodes.length>0){for(var i=0;i<nodes.length;i++)
{nodes[i].style.visibility="hidden";}}else{if(typeof document.applets[0]=='object'){document.applets[0].style.visibility="hidden";}
else{nodes=document.getElementsByTagName('object');if(nodes.length>0){for(var j=0;j<nodes.length;j++)
{nodes[j].style.visibility="hidden";}}}}}
function showApplets(){var nodes=document.getElementsByTagName('applet');if(nodes.length>0){for(var i=0;i<nodes.length;i++)
{nodes[i].style.visibility="visible";}}else{if(typeof document.applets[0]=='object'){document.applets[0].style.visibility="visible";}else{nodes=document.getElementsByTagName('object');if(nodes.length>0){for(var j=0;j<nodes.length;j++)
{nodes[j].style.visibility="visible";}}}}}
function newHelp(helpPage){var helpCookie=$.cookie("rcsb_help_layout");if(helpCookie===null||helpCookie===undefined){hideApplets();$('#helpFrame').attr('src','/pdb/staticHelp.do?p='+helpPage);$('#helpPopout').attr('href',"/pdb/staticHelp.do?p="+helpPage);$('#helpOverlay').show();$('#helpContent').show();}else{var newHelpWindow=window.open("/pdb/staticHelp.do?p="+helpPage,'helpWindow','menubar=no,width=880,height=550,toolbar=yes,scrollbars=yes,resizable=no');newHelpWindow.focus();}
return false;}
